import { gr } from '../../data';
import './BlueCard.css'

const BlueCard = () => {
  return (
    <>
    <div className='blue-body'>

   {
       gr.map((cur, index) =>
       <img className="multi__image_card" src={cur} alt="" style={{width:"300px"}} key={index.toString()}/>
       )
   }



    </div>
    </>
  )
}

export default BlueCard;
